            const data = await response.json()
            return data
        } catch(error) {
            console.log("Error fetching data:",error);
        }
    }
    return (
        <div>
            <header className='header'>
                <h1>Welcome!</h1>
            </header>
            <Form onSubmit={getQuestions} />
            <Quiz questions={get} />
        </div>
    )
}
